import React from "react";
import "./MultiUser.css";

function MultiUser() {
  const urlArray = window.location.href;
  let handle1 = "",
    handle2 = "";
  let i = urlArray.length - 1;

  while (urlArray[i] !== "&") {
    handle2 = handle2 + urlArray[i];
    i--;
  }
  i--;

  while (urlArray[i] !== "/") {
    handle1 = handle1 + urlArray[i];
    i--;
  }

  const reverse = (str) => {
    let revStr = "";
    for (var j = str.length; j >= 0; --j) {
      revStr = revStr + str[j];
    }
    return revStr;
  };

  handle1 = reverse(handle1);
  handle2 = reverse(handle2);

  console.log(handle1, handle2);

  return (
    <div className="multi">
      <h1>I am MultiUser</h1>
    </div>
  );
}

export default MultiUser;
